import React from 'react';
const Weather=()=>{
    return(
        <div className="container">

            <div className="cards">
            <h1>London</h1>
            <h5 className="py-4"></h5>
            <i className="wi wi-day-sunny display-1"/>
            <h1 className="py-2">25</h1>
            </div>
        </div>
    );
};
export default Weather;
